import React from 'react';
import { Link } from "react-router-dom"
import { FaTelegram } from "react-icons/fa";
import { IoLogoWhatsapp } from "react-icons/io";


const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-content">
        <div className="footer-section">
          <div>DELRON</div>
          <p>Ваш надежный партнер в мире автомобильных красок</p>
          <div className="social-links">
            <Link className = "Link" to="/"><FaTelegram /></Link>
            <Link className = "Link" to="/"><IoLogoWhatsapp /></Link>
          </div>
        </div>
        <div className="footer-section">
          <div>Контакты</div>
          <ul>
            <li>+7 (999) 123-45-67</li>
            <li>info@delron.ru</li>
            <li>г. Казань, ул. Восход, 45Ак3</li>
          </ul>
        </div>
        
      </div><div className="footer-bottom">
          <p>© 2024 DELRON. Все права защищены</p>
        </div>
      
    </footer>
  );
};

export default Footer;
